import axios from 'axios'

const personasURL = "http://localhost:3050/personas/";

const PostPersona = (data) =>{
    axios({
        method: 'post',
        url: personasURL,
        data: data
      }).then(()=>{
          alert("persona agregada")
      }).catch(err =>{
          alert(err)
      });
}

export {PostPersona}
